package main

func Minpath(grid [][]int, k int) []int {
	n := len(grid)

	// Find position of value 1
	var startRow, startCol int
	for i := 0; i < n; i++ {
		for j := 0; j < n; j++ {
			if grid[i][j] == 1 {
				startRow, startCol = i, j
				break
			}
		}
	}

	result := make([]int, 0)
	found := false

	var dfs func(row, col int, path []int)
	dfs = func(row, col int, path []int) {
		if found {
			return
		}

		if len(path) == k {
			result = append([]int{}, path...)
			found = true
			return
		}

		// Get neighbors and sort by their values
		neighbors := []struct {
			r, c, val int
		}{}

		directions := [][]int{{-1, 0}, {1, 0}, {0, -1}, {0, 1}}
		for _, dir := range directions {
			nr, nc := row+dir[0], col+dir[1]
			if nr >= 0 && nr < n && nc >= 0 && nc < n {
				neighbors = append(neighbors, struct {
					r, c, val int
				}{nr, nc, grid[nr][nc]})
			}
		}

		// Sort neighbors by value to explore smallest first
		for i := 0; i < len(neighbors); i++ {
			for j := i + 1; j < len(neighbors); j++ {
				if neighbors[j].val < neighbors[i].val {
					neighbors[i], neighbors[j] = neighbors[j], neighbors[i]
				}
			}
		}

		// Try each neighbor
		for _, nb := range neighbors {
			if found {
				return
			}
			path = append(path, grid[nb.r][nb.c])
			dfs(nb.r, nb.c, path)
			path = path[:len(path)-1]
		}
	}

	dfs(startRow, startCol, []int{grid[startRow][startCol]})
	return result
}
